var app=angular.module("seed",["ngRoute"]);app.config(["$routeProvider",function(e){e.when("/",{templateUrl:"assets/app/views/home.html"}).when("/users",{templateUrl:"assets/app/views/users/all.html",controller:"UserCtrl"}).when("/user",{templateUrl:"assets/app/views/users/user.html",controller:"UserCtrl"})}]),app.controller("UserCtrl",["$scope","UserService",function(e,r){e.listAllUsers=function(){r.getUsers().then(function(r){e.users=r.data})},e.findUser=function(){r.getUser().then(function(r){e.user=r.data})}}]),app.service("UserService",["$scope",function(e){return{getUsers:function(){return e.get("/users").then(function(e){return e})},getUser:function(){return e.get("/user").then(function(e){return e})}}}]);